import React from "react";
import { useState } from "react";
import axios from "axios";

function Login() {
  const [username, setUsername] = useState("");
  const [mobileNumber, setMobileNumber] = useState("");
  const [dob, setDob] = useState("");
  const [countryFrom, setCountryFrom] = useState("");
  const [currentCountry, setCurrentCountry] = useState("");
  const [motherTongue, setMotherTongue] = useState("");
  const [profession, setProfession] = useState("");
  const [loginStatus, setLoginStatus] = useState("");

  const login = () => {
    axios
      .post("http://localhost:3001/login", {
        mobile: mobileNumber,
      })
      .then((response) => {
        console.log(response);
        if (response.data.message) {
          setLoginStatus(response.data.message);
        } else {
          sessionStorage.setItem("accessToken", response.data.token);
          setUsername(response.data.user.username);
          setMobileNumber(response.data.user.mobile);
          setDob(response.data.user.dob);
          setCountryFrom(response.data.user.countryfrom);
          setCurrentCountry(response.data.user.currentcountry);
          setMotherTongue(response.data.user.mothertongue);
          setProfession(response.data.user.profession);
          <div>
            <h1>{username}s</h1>
            <h1>{mobileNumber}</h1>
            <h1>{dob}</h1>
            <h1>{countryFrom}</h1>
            <h1>{currentCountry}</h1>
            <h1>{motherTongue}</h1>
            <h1>{profession}</h1>
          </div>;
          setLoginStatus(username);
        }
      });
  };

  return (
    <div>
      <h1>Login</h1>
      {/* Mobile Number */}
      <label>Mobile Number: </label>
      <input
        type="tel"
        onChange={(event) => {
          setMobileNumber(event.target.value);
        }}
      />
      <button onClick={login}>Login</button>
    </div>
  );
}

export default Login;
